$(document).ready(function() {
	var rocket = $('#rocket');
	if (WIDTH() !== 'xs' && rocket.length) {
		var css = {};
		var animate = function() {
			css['margin-left'] = ((Math.random() * 15) >> 0) - 7;
			css['margin-top'] = ((Math.random() * 15) >> 0) - 7;
			rocket.animate(css, { duration: 400, done: animate });
		};
		animate();
	}
});
